int32_t uni2utf8(uint16_t ns, uint8_t buf[4]) {
    if ((ns < 0xFF) || (NULL == buf)) {
        // Hanzi encoding greater than 0xFF
        return -1;
    }
#if 1
    if ((ns == 0x0251) || (ns == 0x0261) || (ns == 0x02C9) || (ns == 0x02C7) || (ns == 0x02CA) || (ns == 0x02CB) ||
        (ns == 0x02D9) || (ns == 0x0401) || (ns == 0x0451)) {
        return -1;
    }
    if ((ns >= 0x0410) && (ns <= 0x044F)) {
        return -1;
    }
#endif
    if (0 != (ns & 0xF100)) {
        buf[0] = (ns & 0xF000) >> 12 | 0xE0;
        buf[1] = (ns & 0x0FC0) >> 6 | 0x80;
        buf[2] = (ns & 0x003F) | 0x80;
        buf[3] = 0;
    } else {
        buf[0] = (ns & 0x07C0) >> 6 | 0xE0;
        buf[1] = (ns & 0x003F) | 0x80;
        buf[2] = 0;
        buf[3] = 0;
    }
    return 0;
}

char *gbk2utf8(const uint8_t *data, size_t len) {
    uint32_t i = 0, j = 0;
    bool flg = false;
    int32_t count = 0;
    char *p_ret = NULL;
    uint8_t *p_cur = NULL;
    uint8_t *p_src = NULL;
    uint32_t p_len = 0;
    const uint8_t *cur = NULL;
    uint8_t buf[4] = {0};

    if ((NULL == data) || (len <= 0)) {
        return NULL;
    }

    if (!is_valid_gbk(data, len)) {
        return NULL;
    }

    p_len = ((len * 2) + 1);
    p_src = (uint8_t *)malloc(p_len);
    if (NULL == p_src) {
        goto __oops;
    }
    memset(p_src, 0, p_len);

    flg = true;

    for (i = 0, cur = data, p_cur = p_src; (i < len) && (p_cur < (p_src + p_len)) && flg; i++, cur++) {
        if ((*cur & 0x80) == 0) {
            /* 0xxxxxxx */
            *p_cur++ = *cur;
            continue;
        } else if ((*cur > 0x80) && (*cur < 0xFF)) {
            if ((i + 1) >= len) {
                flg = false;
                break;
            }
            count = *cur - 0x81;
            i += 1;
            cur += 1;
            if ((*cur < 0x40) || (*cur == 0xFF) || (*cur == 0x7F)) {
                flg = false;
                break;
            }
            count = count * 12 * 16 + *cur - 0x40;
            if (count >= GBK2UNI_TABLE_SIZE) {
                flg = false;
                break;
            }
            if (0 != uni2utf8(GBK2UNI_TABLE[count], buf)) {
                flg = false;
                break;
            }
            for (j = 0; j < sizeof(buf); j++) {
                if (0 == buf[j]) {
                    break;
                }
                *p_cur++ = buf[j];
            }
        } else {
            flg = false;
            break;
        }
    }

    if (flg != false) {
        *p_cur = 0;
        p_ret = strdup((char *)p_src);
    }

__oops:
    if (p_src) {
        free(p_src);
        p_src = NULL;
    }

    return p_ret;
}

